description:
This demo is from a cover cd from some UK magazine.
Three battles to play. Qoute from totalwar.com:

&quot;Rome: Total War - Barbarian Invasion is the expansion to the best-selling Rome: Total War. The original game covered the rise of the Roman Empire and the struggle to be the Emperor of the Roman World. In the tradition of earlier Total War expansions, Barbarian Invasion (BI) introduces a new campaign in a time when an almost-unstoppable threat has arisen.&quot;
